import React from 'react';
import Header from "../Header";
import Footer from "../Footer";
import Trips from "../Trips"

import TRIP_CHORWACJA from "../Assets/TRIP_CHORWACJA.jpg"
import TRIP_BACKGROUND from "../Assets/TRIP_BACKGROUND.jpg"

const Trip = () => {
    return (
        <div>
            <Header/>
            <section className="trips container">
                <Trips title={"Chorwacja 08-09.2022"} link={"/"} text={"Dwutygodniowy wyjazd do Chorwacji, gdzie dodatkowo zwiedzilismy takie kraje jak Albania i Czarnogora"} image={TRIP_CHORWACJA} country={"Słowacja","Węgry"}/>
            </section>
            <img className="trips_background" src={TRIP_BACKGROUND} alt="image" />
            <Footer/>
        </div>
    );
};

export default Trip;
